import styled, {css} from 'styled-components'

export const StyledDiv = styled.div`
    height: 100vh; 
    color: #fff;
  width: 200px;
  height: 40px;
  border-radius: 10px;
  margin-top: 50px;
  display: block;
  text-align: center;
  line-height: 40px;`
